import React, { useState, useEffect } from 'react';
import Header from '../components/header';
import { BiSolidTrash } from 'react-icons/bi';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const EditQuizz = () => {
    const { id } = useParams(); // Récupérer l'ID du quizz depuis l'URL
    const [quizz, setQuizz] = useState({});
    const [titre, setTitre] = useState('');
    const [questions, setQuestions] = useState(['']);

    useEffect(() => {
        // Effectuer une requête pour récupérer les détails du quizz à éditer
        axios.get(`http://localhost:3001/api/quizz/${id}`)
            .then(response => {
                setQuizz(response.data);
                setTitre(response.data.titre); // Utiliser response.data.titre
                setQuestions(response.data.questions.map(question => question.libelle));
            })
            .catch(error => {
                console.error('Erreur lors de la récupération des détails du quizz :', error);
                // Gérer l'erreur
            });
    }, [id]);

    const handleAddQuestion = () => {
        setQuestions([...questions, '']);
    };

    const handleRemoveQuestion = (index) => {
        const newQuestions = [...questions];
        newQuestions.splice(index, 1);
        setQuestions(newQuestions);
    };

    const handleQuestionChange = (index, value) => {
        const newQuestions = [...questions];
        newQuestions[index] = value;
        setQuestions(newQuestions);
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        const token = localStorage.getItem('token'); // Récupérer le token du localStorage
        console.log(token)
        if (!token) {
            console.error('No token found');
            return;
        }

        // Préparer les données à envoyer au backend
        const data = {
            titre,
            questions: questions.map(question => ({ libelle: question }))
        };

        console.log('Data to be sent:', data);

        axios.put(`http://localhost:3001/api/quizz/${id}`, data, {
            headers: {
                'Authorization': token // Ajouter le token dans les en-têtes
            }
        })
        .then(response => {
            // Traiter la réponse du backend si nécessaire
            console.log(response.data);
            // Rediriger ou afficher un message de succès
        })
        .catch(error => {
            console.error('Erreur lors de la mise à jour du quizz :', error);
            // Afficher un message d'erreur
        });
    };

    return (
        <div>
            <Header />
            <div className="container">
                <div className="row justify-content-center mt-5">
                    <div className="col-md-6">
                        <div className="card p-4">
                            <h2 className="mb-4">Édition de formulaire</h2>
                            <form onSubmit={handleSubmit}>
                                <div className="mb-3">
                                    <label htmlFor="titre" className="form-label">Titre</label>
                                    <input type="text" className="form-control" id="titre" value={titre} onChange={(e) => setTitre(e.target.value)} required />
                                </div>
                                <div className="mb-3">
                                    <label className="form-label">Questions</label>
                                    {questions.map((question, index) => (
                                        <div key={index} className="input-group mb-3">
                                            <input type="text" className="form-control" value={question} onChange={(e) => handleQuestionChange(index, e.target.value)} required />
                                            <button type="button" className="btn btn-outline-danger" onClick={() => handleRemoveQuestion(index)}><BiSolidTrash /></button>
                                        </div>
                                    ))}
                                    <button type="button" className="btn btn-primary mb-3" onClick={handleAddQuestion}>Ajouter une question</button>
                                </div>
                                <button type="submit" className="btn btn-primary">Enregistrer</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default EditQuizz;
